i64 binpow(i64 b, i64 e, i64 MOD) {
  i64 res = 1;
  while (e > 0) {
    if (e & 1) res = (__int128_t)(res * b) % MOD;
    b = (__int128_t)(b * b) % MOD;
    e >>= 1;
  }
  return res;
}

