class ChatApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: ChatScreen(),
    );
  }
}

class ChatScreen extends StatefulWidget {
  @override
  _ChatScreenState createState() => _ChatScreenState();
}

class _ChatScreenState extends State<ChatScreen> {
  List<Message> _messages = []; // List to store chat messages
  TextEditingController _textController = TextEditingController();

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Group Chat'),
      ),
      body: Column(
        children: [
          Expanded(
            child: ListView.builder(
              reverse: true,
              itemCount: _messages.length,
              itemBuilder: (context, index) {
                Message message = _messages[index];
                bool isMe = message.senderName == 'Me'; // Replace 'Me' with the user's name
                return ChatBubble(
                  message: message.content,
                  senderName: message.senderName,
                  isMe: isMe,
                  time: message.timestamp,
                );
              },
            ),
          ),
          Container(
            padding: EdgeInsets.symmetric(horizontal: 8.0),
            child: Row(
              children: [
                Expanded(
                  child: TextField(
                    controller: _textController,
                    decoration: InputDecoration(hintText: 'Type a message...'),
                  ),
                ),
                IconButton(
                  icon: Icon(Icons.send),
                  onPressed: () {
                    _sendMessage();
                  },
                ),
              ],
            ),
          ),
        ],
      ),
    );
  }

  // Function to send a new message
  void _sendMessage() {
    String text = _textController.text;
    if (text.trim().isNotEmpty) {
      // Replace 'Me' with the user's name
      Message newMessage = Message(senderName: 'Me', content: text, timestamp: DateTime.now());
      setState(() {
        _messages.insert(0, newMessage);
      });
      _textController.clear();
    }
  }
}

