		minValue: 0,
		maxValue: 127,
		defaultValue: 0,
		numberOfSteps: 127,
	},
	{
		name: "MIDI Channel",
		type: "lin",
		minValue: 1,
		maxValue: 16,
		defaultValue: 3,
		numberOfSteps: 15,
	},
];

function HandleMIDI(event) {
	if (event.channel === GetParameter("MIDI Channel") && typeof event.pitch === "number") {
		const octave = Math.floor(event.pitch / 12);
		const mappedNote = majorMinorMap[GetParameter("Scale Type")][event.pitch % 12];
		event.pitch = mappedNote + (GetParameter("Octave Offset") + octave) * 12 + GetParameter("Root Note");
		event.channel = 1;
		if (GetParameter("Fixed Velocity") > 0) {
			event.velocity = GetParameter("Fixed Velocity");
		}
	}
	event.send();
}

class Solution {
public:
    vector<int> twoSum(vector<int>& numbers, int target) {
        
        for(int i = 0; i < numbers.size(); ++i){

            const int j = lower_bound(numbers.begin(), numbers.end(), target - numbers[i]) - numbers.begin();

            /* "i != j"  на случай numbers = [0,0,3,4] target = 0*/
            /* "j !=  numbers.size()"  на случай numbers = [1,3,4,4] target = 8 -- т.е. lower_bound(numbers.begin(), numbers.end(), target - numbers[i]) указвает на  numbers.end()*/
            if(j !=  numbers.size()  && i != j && numbers[j] == target - numbers[i]){ 

                return { min(i + 1, j + 1), max(i + 1, j + 1) }; 
                
            }

        }

        return {};
        
    }
};

class Solution {
public:
    vector<int> twoSum(const vector<int>& a, int target) {
        for (int i = 0; i < (int)a.size(); i++) {

            int j = (int)(upper_bound(a.begin(), a.end(), target - a[i]) - a.begin()) - 1;

            if (j != i && j >= 0 && a[j] == target - a[i]) {return { i + 1, j + 1 };}

        }

        throw invalid_argument("no sum target");
        
    }
};

