#define int long long

const long long INF = 1e18 + 7;
const int MAXN = 1e2 + 100;
const int N = 1e5 + 10;

int beam, n;
vector<int> a;
array<array<int, MAXN>, MAXN> dp;

int rec(int l, int r) {
    if (dp[l][r] != INF) {
        return dp[l][r];
    }
    int ans = INF;
    for (int m = l + 1; m < r; ++m) {
        ans = min(ans, rec(l, m) + rec(m, r) + a[r] - a[l]);
    }
    return dp[l][r] = ans;
}

